cluding whether it has a rocky core, the amount of water present within the deep atmosphere, mass distribution, and its deep winds](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). [Juno is the second spacecraft to orbit Jupiter, after the Galileo orbiter, which orbited from 1995 to 2003](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29). [Unlike all earlier spacecraft sent to the outer planets, Juno is powered by solar panels](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29)[1](https://en.wikipedia.org/wiki/Juno_%28spacecraft%29).logseq____&quot;,536871008]],[logseq____&quot;^15logseq____&quot;,[2264,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536871008]],[logseq____&quot;^15logseq____&quot;,[2264,logseq____&quot;^Flogseq____&quot;,193,536871008]],[logseq____&quot;^15logseq____&quot;,[2264,logseq____&quot;^Xlogseq____&quot;,193,536871008]],[logseq____&quot;^15logseq____&quot;,[2264,logseq____&quot;^Vlogseq____&quot;,193,536871008]],[logseq____&quot;^15logseq____&quot;,[2264,logseq____&quot;^Ulogseq____&quot;,193,536871008]],[logseq____&quot;^15logseq____&quot;,[2264,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u65a44889-bd67-472e-b647-5db5bbbc02d9logseq____&quot;,536871008]],[logseq____&quot;^15logseq____&quot;,[2266,logseq____&quot;^Klogseq____&quot;,1705265289363,536871009]],[logseq____&quot;^15logseq____&quot;,[2266,logseq____&quot;^@logseq____&quot;,false,536871009]],[logseq____&quot;^15logseq____&quot;,[2266,logseq____&quot;^Ylogseq____&quot;,logseq____&quot;list of rocketry teamslogseq____&quot;,536871009]],[logseq____&quot;^15logseq____&quot;,[2266,logseq____&quot;^11logseq____&quot;,logseq____&quot;List of Rocketry Teamslogseq____&quot;,536871009]],[logseq____&quot;^15logseq____&quot;,[2266,logseq____&quot;^Blogseq____&quot;,1705265289363,536871009]],[logseq____&quot;^15logseq____&quot;,[2266,logseq___
